import { Route, Routes } from "react-router-dom";
import AppNavbar from "./components/AppNavbar";
import Home from "./pages/Home";

const App = () => {
  return <AppNavbar />;
  <Routes>
    <Route element={<Home />} />
  </Routes>;
};

export default App;
